import React from 'react'
import './intro.css'
import backImg from '../../background_images/back-img.png'
import playstore from '../../background_images/play.png'
const Intro = ()=>{
    return(
        <div className="back">
        <img src={backImg} className='intro' alt='Img'/>
        <p className="logo-img">THE LOGO</p>
        <div className="box">
        <a className="play-link" href="https://play.google.com/store/apps/details?id=com.krishiji" target="blank"><img src={playstore} alt="Facebook"/></a>
        </div>
        </div>
    )
}
export default Intro;
